當然做嘅嘢唔係咁少啦，中間仲有好多辛酸嘢沒影底，但係呢一啲係見證住我踏前一步嘅足跡。下一步就係踏上麥花臣呢個台。我都好希望你哋可以見證住我，陪着我成長。❤️

音樂祭:
為咗追夢，究竟🤨可以去到幾盡？ 
雨橋遠赴日本🇯🇵做練習生，到成為陳奕迅世界巡迴演唱會Dancers，再參與「全民造星II」，2021年舉辦個人演唱會。10年來從來沒有放棄演藝之夢。

雨僑將於9月4日參與「花漾男生音樂祭」踏上麥花臣舞台，與大家一齊激發所有夢想與努力。🎉💪

